                        "What keeps VUSDT prices stable?": {
                            msgid: "What keeps VUSDT prices stable?",
                            msgstr: ["\u4ec0\u4e48\u8ba9 VUSDT \u4ef7\u683c\u4fdd\u6301\u7a33\u5b9a\uff1f"]
                        },
                        "Equilibrium incentivizes third-party participants, known as arbitrators, to maintain VUSDT\u2019s USD peg. Arbitrators are automated programs that search for arbitrage opportunities when VUSDT\u2019s price deviates from the peg. They also participate in liquidation auctions to ensure timely management of liquidated debt and collateral.": {
                            msgid: "Equilibrium incentivizes third-party participants, known as arbitrators, to maintain VUSDT\u2019s USD peg. Arbitrators are automated programs that search for arbitrage opportunities when VUSDT\u2019s price deviates from the peg. They also participate in liquidation auctions to ensure timely management of liquidated debt and collateral.",
                            msgstr: ["Equilibrium \u6fc0\u52b1\u7b2c\u4e09\u65b9\u53c2\u4e0e\u8005\uff08\u5373\u4ef2\u88c1\u5458\uff09\u8ba9 VUSDT \u59cb\u7ec8\u951a\u5b9a\u7f8e\u5143\u4ef7\u683c\u3002 \u4ef2\u88c1\u5458\u662f\u81ea\u52a8\u7a0b\u5e8f\uff0c\u5f53 VUSDT \u4ef7\u683c\u504f\u79bb\u951a\u5b9a\u4ef7\u683c\u65f6\uff0c\u5957\u5229\u8005\u5c06\u4f1a\u628a\u4ef7\u683c\u642c\u5e73\u3002 \u540c\u65f6\u4e5f\u53c2\u4e0e\u6e05\u7b97\u62cd\u5356\uff0c\u4ee5\u786e\u4fdd\u53ca\u65f6\u7ba1\u7406\u6e05\u7b97\u503a\u52a1\u548c\u62b5\u62bc\u54c1\u3002"]
                        },
                        "VUSDT is stable cryptocurrency with a predictable price and low volatility versus its peers, so it\u2019s suitable for a wide range of financial activities. For example:": {
                            msgid: "VUSDT is stable cryptocurrency with a predictable price and low volatility versus its peers, so it\u2019s suitable for a wide range of financial activities. For example:",
                            msgstr: ["VUSDT \u662f\u52a0\u5bc6\u8d27\u5e01\u4e2d\u7684\u7a33\u5b9a\u5e01\uff0c\u4e0e\u540c\u7c7b\u4ea7\u54c1\u76f8\u6bd4\uff0c\u5176\u4ef7\u683c\u53ef\u9884\u6d4b\u5e76\u5177\u6709\u4f4e\u6ce2\u52a8\u6027\u7684\u7279\u70b9\uff0c\u56e0\u6b64\u9002\u7528\u4e8e\u5e7f\u6cdb\u7684\u91d1\u878d\u6d3b\u52a8\u3002 \u4f8b\u5982\uff1a"]
                        },
                        "Leverage: Users can get more capital by generating VUSDT without spending the collateral they have a bullish exposure to.": {
                            msgid: "Leverage: Users can get more capital by generating VUSDT without spending the collateral they have a bullish exposure to.",
                            msgstr: ["\u6760\u6746\uff1a \u7528\u6237\u53ef\u4ee5\u901a\u8fc7\u751f\u6210 VUSDT \u83b7\u5f97\u66f4\u591a\u8d44\u91d1\uff0c\u800c\u65e0\u9700\u4f7f\u7528\u4ef7\u503c\u53ef\u80fd\u4f1a\u4e0a\u6da8\u7684\u62b5\u62bc\u54c1\u3002"]
                        },
                        "Hedging: During periods of market turmoil, VUSDT offers a safe-haven for preserving the value of user holdings.": {
                            msgid: "Hedging: During periods of market turmoil, VUSDT offers a safe-haven for preserving the value of user holdings.",
                            msgstr: ["\u5bf9\u51b2\uff1a \u5728\u5e02\u573a\u52a8\u8361\u671f\u95f4\uff0cEOSDT \u4e3a\u7528\u6237\u63d0\u4f9b\u4fdd\u6301\u5176\u6301\u6709\u4ef7\u503c\u7684\u907f\u98ce\u6e2f\u3002"]
                        },
                        "Lending and borrowing: High volatility creates an uncertain lending environment where borrowers and lenders can\u2019t effectively gauge how risky a loan might be. VUSDT\u2019s low volatility is perfectly suited for stable, predictable loans.": {
                            msgid: "Lending and borrowing: High volatility creates an uncertain lending environment where borrowers and lenders can\u2019t effectively gauge how risky a loan might be. VUSDT\u2019s low volatility is perfectly suited for stable, predictable loans.",
                            msgstr: ["\u8d37\u5165\u548c\u8d37\u51fa\uff1a \u9ad8\u6ce2\u52a8\u6027\u9020\u6210\u4e86\u4e0d\u786e\u5b9a\u7684\u8d37\u6b3e\u73af\u5883\uff0c\u501f\u6b3e\u4eba\u548c\u8d37\u6b3e\u4eba\u65e0\u6cd5\u6709\u6548\u8861\u91cf\u501f\u8d37\u7684\u98ce\u9669\u7a0b\u5ea6\u3002\u76f8\u6bd4\u4e4b\u4e0b\uff0cEOSDT \u7684\u4f4e\u6ce2\u52a8\u6027\u975e\u5e38\u9002\u5408\u7a33\u5b9a\u7684\u3001\u53ef\u9884\u6d4b\u7684\u501f\u8d37\u3002"]
                        },
